import {Link} from "react-router-dom";
import {Background, LeftMenu} from "./styles";

const AppLayout = ({ children }) => {
  return (
    <Background>
      <LeftMenu>
        <h1>Mucvies</h1>
        <ul>
          <li>
            <Link to="/">
              박스오피스
            </Link>
          </li>
        </ul>
      </LeftMenu>
      <div>
        {children}
      </div>
    </Background>
  );
};

export default AppLayout;
